import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import {useDispatch} from "react-redux/src";

const CallLogs = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const loadingSpinner = useSelector(state => state.loadingSpinner);
    const [spinner, showSpinner] = useState(false);
    const dispatch = useDispatch();
    useEffect(() => {
        showSpinner(true);
        // dispatch({spinner, type: "GET_LOADING_SPINNER_STATUS"});
    }, [cdrsData]);
    return (

        <table className="table table-sm table-striped table-bordered table-hover">
            <thead>
            <tr>
                <th>Date/Time</th>
                <th>From</th>
                <th>To</th>
                <th>Duration</th>
            </tr>
            </thead>
            <tbody>{
                cdrsData === undefined ? null : cdrsData.map((item, i) => {

                    return (
                        <tr key={i}>

                            <td>
                                {item.unix_timestamp}
                            </td>
                            <td>
                                {item.from}
                            </td>
                            <td>
                                {item.to}
                            </td>
                            <td>
                                {item.duration_seconds}
                            </td>
                        </tr>
                    )

                })
            }
            </tbody>
        </table>
    )

};


export default CallLogs;
